import { Avatar } from '@material-ui/core';
import React from 'react';
import "./Message.css";

function Message({id, content}) {
    return (
        <div className="message">
            <Avatar src={content.photo}/>
            <p>{content.message}</p>
            <small></small>
        </div>
    )
}

export default Message
